webpackJsonp([0xd2c6e9ff2d61],{1573:function(e,a){e.exports={data:{markdownRemark:{html:'<p>이른 아침, Tiger Book의 "Bitter World"를보십시오. Tiger Book Series는 중국에서 처음으로 등록 된 상표권 서적이며 외국 인기 또는 베스트셀러 소설을 모방 한 것으로 작성되었습니다. "쓴 세상"이란 한 중국인 의사가 중국으로 돌아와서 납치 당하고 감기에 걸린 살인범으로 훈련되어 북경 사무소에 갔다가 중국 소녀와 관계를 가졌음을 의미하며 감정의 영향으로 인류애가 돌아왔다. 그것은 잘 만들어진 이야기지만 허구의 이야기는 사람들로 하여금 그 허구가 너무 명백하다는 것을 느끼게합니다. 그러나 이런 종류의 소설은 그런 스타일 일뿐입니다. 주요 "msg"는 여러 여성과 남성 사이의 관계이며,</p>\n<p>"침대 운동"이 너무 많이 보인다. 그러나 폐기물 도시보다 조금 적기 때문에 저자가 여기에서 여러 단어 구름을 삭제할 필요가 없습니다. 이것은 베스트 셀러의 초기 단계이며 특정 예술 영역을 포함하지 않습니다. 이야기의 무결성과 신뢰성은 그다지 높지 않습니다.</p>\n<p>국제 관계와 국제 정치에서 대학원생의 방향 설정을 논의하기 위해서는 최첨단 과학을 목표로하고 우리 자신의 분야를 업데이트해야하며 더 중요한 것은 지식 구조를 업데이트하는 것입니다. 업데이트에 대한 지식이 없으면 업데이트 방향의 이름이 충분하지 않을 수 있습니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0020.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0020.md",frontmatter:{title:"1월 28일 금요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0020.md absPath of file >>> MarkdownRemark"}}}});
